    e.target.src ="http://localhost:3000/uploads/loading-img.jpg";
}
const Product = (props) =>{
    return (
        <div className="">
            <div className="rounded">
                <img src={`http://localhost:3000/${props.img}`} onError={()=>{handleOnError}} />
            </div>
        </div>
    );
}

export default Product
